import React from 'react'

function Clock() {
    return (
        <div className='clock'>
            <div className='leftmenu-clock-time'>
                <p className='leftmenu-clock-time-hours'>21</p>
                <p className='leftmenu-clock-time-minutes'>06</p>
            </div>
            <p className='leftmenu-clock-day'>Thursday</p>
        </div>
    )
}

export default Clock
